Cocopét Cocopét (serangga anggota ordo Dermaptera) dicirikeun ku jangjang nu nilep handapeun jangjang luar nu kandel, abdoménna panjang ngaleuwihan jangjangna, nu ditungtungan ku cacapit. Jumlah spésiés kacatet nu 1.800 ti sapuluh famili téh pikeun ukuran serangga mah kawilang saeutik, tapi cocopét sumebar ampir di sakuliah dunya, sok kapanggih aya di lingkungan jero imah. Daptar eusi Fisiologi[édit | sunting sumber] Cocopét mah lolobana boga warna coklat kolot atawa hideung. Panjangna 10-14 mm;
